import React, { Component } from "react";
import {Grid,Box} from '@material-ui/core'
import './style.css';
function Window(){
    return( 
       // <h1>book</h1>
       <div className="window">
        <mat-grid-list cols="3" rowHeight="1:1"></mat-grid-list>
           <button  containerStyle={{padding:10, height:45, overflow:'hidden', 
       borderRadius:50, backgroundColor: 'white'}}
       style={{fontSize: 20, color: 'blue'}} >
             <mat-grid-tile> Add Book</mat-grid-tile>   
            </button>
           <button  containerStyle={{padding:10, height:45, overflow:'hidden', 
       borderRadius:50, backgroundColor: 'white'}}
       style={{fontSize: 20, color: 'blue'}}>
           <mat-grid-tile> Edit Book</mat-grid-tile>
            </button>
           <button containerStyle={{padding:10, height:45, overflow:'hidden', 
       borderRadius:50, backgroundColor: 'white'}}
       style={{fontSize: 20, color: 'blue'}}>
         <mat-grid-tile> List All Book</mat-grid-tile>
            </button>
           
       </div>


    );
}
export default Window;



